public void testSetValueInvalidKeyNames() throws Exception {
	ConfigStore s = initStore("Foo.cfg");
	ConfigMap cm = s.getMap("Foo.cfg");

	String[] test = {
		"", " ", "\t",
		"foo=bar", "=",
		"foo/bar", "/",
		"foo[bar", "]",
		"foo]bar", "]",
		"foo\\bar", "\\",
		"foo#bar", "#",
		null
	};

	for (String t : test) {
		assertThrown(()->cm.setEntry("S1", t, "foo", null, null, null)).contains("Invalid key name");
	}
}

